script: |
  super -f text -I q5102.spq | sort > q5102.out

inputs:
  - name: q5102.spq
    data: |
      SELECT DISTINCT col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT CAST ( NULL AS INTEGER ) NOT BETWEEN + col2 AND ( - 20 * col2 / + 12 * - col2 / + - col1 );
  - name: tab1

outputs:
  - name: q5102.out
    data: |
